package com.bl360x.printdriverblx;

import android.content.Context;
import android.content.SharedPreferences;
import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.util.Base64;

import androidx.annotation.NonNull;
import androidx.work.Data;
import androidx.work.Worker;
import androidx.work.WorkerParameters;

import com.epson.epos2.printer.Printer;
import com.epson.epos2.printer.PrinterStatusInfo;
import com.epson.epos2.printer.ReceiveListener;

import java.util.List;

public class EPSONPrintWorker extends Worker implements ReceiveListener {
    private static Printer mPrinter = null;
    private Context mContext = null;
    private int printerModel = -1;
    private String bluetoothMac = "",url = "",report = "",parameters="";

    private String companyKey = "",orderId = "",transactionTypeKey = "",token="";
    private int DISCONNECT_INTERVAL = 500;

    private APIInteraction apiInteraction;
    public EPSONPrintWorker(@NonNull Context context, @NonNull WorkerParameters workerParams)  {
        super(context, workerParams);
        SharedPreferences sharedPreferences = context.getSharedPreferences("PREF_NAME_BL360X",Context.MODE_PRIVATE);
        bluetoothMac = sharedPreferences.getString("PREF_BT_MAC","");
        printerModel = sharedPreferences.getInt("PREF_MODEL",-1);
        apiInteraction = new APIInteraction();
        mContext = context;


    }

    private void addBMPFeed() throws Exception{
        //URL uri = new URL("https://bluelotus360.co/3pl/SGF/Cat/Sun Maid.png");
        //InputStream inputStream = uri.openStream();
        //List<KeyValuePair> list = new ArrayList<>();
        PrintDetails pds = apiInteraction.GetImages(url,companyKey,orderId,transactionTypeKey,token);
        //String b64String = "";
        //byte[] byteBee = Base64.decode(b64String,Base64.DEFAULT);
        List<String> images = pds.printData;
        for(String image : images){
            byte[] byteBee = Base64.decode(image,Base64.DEFAULT);

            Bitmap bmp = BitmapFactory.decodeByteArray(byteBee,0,byteBee.length);
            Bitmap bmp2 = Bitmap.createScaledBitmap(bmp,(int)(bmp.getWidth() *1),(int)(bmp.getHeight()*1),false);
            mPrinter.addImage(bmp2,0,0,bmp2.getWidth(),bmp2.getHeight(),Printer.PARAM_DEFAULT,Printer.MODE_MONO,Printer.HALFTONE_THRESHOLD,Printer.PARAM_DEFAULT,Printer.PARAM_DEFAULT);
        }
        //Bitmap bmp = BitmapFactory.decodeByteArray(byteBee,0,byteBee.length);
        //mPrinter.addImage(bmp,0,0,bmp.getWidth(),bmp.getHeight(),Printer.PARAM_DEFAULT,Printer.MODE_MONO,Printer.HALFTONE_THRESHOLD,Printer.PARAM_DEFAULT,Printer.PARAM_DEFAULT);
    }

    @NonNull
    @Override
    public Result doWork() {
        Data data = getInputData();
        url = "https://bluelotusx.co/apiv2/api/Order/PrintOrderByOrderIdImage";
        //report = data.getString("Report");
        //report = data.getString("parameters");
        companyKey = data.getString("companyKey");
        orderId = data.getString("orderId");
        transactionTypeKey = data.getString("transactionTypeKey");
        token=data.getString("token");
        if(!initializeObject()){
            return Result.failure();
        }

        if(!connectPrinter()){
            return Result.failure();
        }
        try{
            addBMPFeed();
            mPrinter.addCut(Printer.CUT_FEED);
            implementPrint();
            return Result.success();
        }catch (Exception ex){
            return Result.failure();
        }finally{
            mPrinter.clearCommandBuffer();
            try {
                mPrinter.disconnect();
            }
            catch (Exception ex) {
                // Do nothing
            }
        }
    }

    private boolean implementPrint(){
        if(mPrinter == null){
            return false;
        }
        try {
            mPrinter.sendData(Printer.PARAM_DEFAULT);
        }
        catch (Exception e) {
            //Toast.makeText(this, e.getMessage(), Toast.LENGTH_SHORT).show();
            return false;
        }
        return true;
    }

    private boolean connectPrinter(){
        if (mPrinter == null) {
            return false;
        }

        try {
            if(!bluetoothMac.equals("")){
                mPrinter.connect("BT:"+bluetoothMac, Printer.PARAM_DEFAULT);
            }else{
                return false;
            }
        }
        catch (Exception e) {
            //Toast.makeText(this, "Connection Issue Got", Toast.LENGTH_SHORT).show();
            return false;
        }

        return true;
    }

    private boolean initializeObject() {
        try {
            if(printerModel > -1){
                mPrinter = new Printer(printerModel,Printer.MODEL_ANK,mContext);
            }else{
                return false;
            }
        }
        catch (Exception e) {
            //Toast.makeText(this, "Error Ctreating Object", Toast.LENGTH_SHORT).show();
            return false;
        }

        mPrinter.setReceiveEventListener(this);

        return true;
    }

    private void disconnectPrinter(){
        if (mPrinter == null) {
            return;
        }

        while (true) {
            try {
                mPrinter.disconnect();
                break;
            } catch (final Exception e) {
            }
        }

        mPrinter.clearCommandBuffer();
    }

    @Override
    public void onPtrReceive(Printer printer, int i, PrinterStatusInfo printerStatusInfo, String s) {
        new Thread(new Runnable() {
            @Override
            public void run() {
                disconnectPrinter();
            }
        }).start();
    }
}
